    "2015-10-26T17:22:05.174103",nt"name": "tiger-line-shapefile-2015-nation-u-s-114th-congressional-district-national",nt"isopen":
    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation.  Congressional Districts are the 435 areas from which people are elected
    to the U.S. House ofn               Representatives.  After the apportionment of
    congressional seats among the States based on census population counts, each State
    is responsible forn               establishing congressional districts for the purpose
    of electing representatives.  Each congressional district is to be as equal in population
    to alln               other congressional districts in a State as practicable.  The
    114th Congress is seated from January 2015 to 2017. The TIGER/Line shapefiles for
    then               District of Columbia, Puerto Rico, and the Island Areas (American
    Samoa, Guam, the Commonwealth of the Northern Mariana Islands, and the U.S. Virginn
                  Islands) each contain a single record for the non-voting delegate
    district in these areas.  The boundaries of all other congressional districts aren
                  provided to the Census Bureau through the Redistricting Data Program
    (RDP).",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
